import React from 'react';

const TodayClasses = () => {
  return (
    <div className="bg-white p-6 rounded-lg shadow">
      <h2 className="text-xl font-bold mb-4">오늘의 수업</h2>
      <div className="space-y-3">
        {/* localStorage에서 오늘 수업 데이터를 가져와 표시 */}
        <div className="text-gray-600">예정된 수업이 없습니다.</div>
      </div>
    </div>
  );
};

export default TodayClasses;
